script: |
  super -f text -I q5850.spq | sort > q5850.out

inputs:
  - name: q5850.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 IN ( + col1 * - - ( + 64 ) * col0, 29 + - col1, - - ( + col2 ) * - - 39, col1 );
  - name: tab1

outputs:
  - name: q5850.out
    data: |
      51	14	96
      85	5	59
      91	47	68
